import React from 'react';
import './TopBar.css';

function TopBar() {
    return (
        <div className="top-bar">
            <ul>
                <li><a href="#">Cover</a></li>
                <li><a href="#">Intro</a></li>
                <li><a href="#">Education</a></li>
                <li><a href="#">Contact</a></li>
            </ul>
        </div>
    );
}

export default TopBar;
